// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

import "./VerdictVirtualUSDCToken.sol";
import "./VerdictProposalRegistryStorage.sol";
import "./VerdictYESTokenDeployerFactory.sol";
import "./VerdictSimpleAMM.sol";
import "./utils/@openzeppelin/contracts/access/Ownable.sol";

/**
 * @title VerdictPredictionMarketRouter
 * @notice Central entry point for all Verdict Market operations.
 * @dev Accepts pre-deployed contract addresses to reduce bytecode size.
 * 
 * DEPLOYMENT ORDER (deploy each separately, then Router):
 * 1. Deploy VerdictVirtualUSDCToken
 * 2. Deploy VerdictProposalRegistryStorage
 * 3. Deploy VerdictYESTokenDeployerFactory
 * 4. Deploy VerdictSimpleAMM
 * 5. Deploy VerdictPredictionMarketRouter (passing all addresses above)
 * 6. Call setupPermissions() on Router to configure all contracts
 */
contract VerdictPredictionMarketRouter is Ownable {

    // ============ External Contracts ============
    VerdictVirtualUSDCToken public vUSDCToken;
    VerdictProposalRegistryStorage public registry;
    VerdictYESTokenDeployerFactory public factory;
    VerdictSimpleAMM public amm;

    address public backendSigner;
    uint256 public currentRound;
    bool public isMarketActive;
    bool public permissionsConfigured;

    // Tracking
    mapping(string => address) public proposalToYesToken;
    mapping(string => bytes32) public proposalToPoolId;

    event ContractsLinked(address vUSDC, address registry, address factory, address amm);
    event PermissionsConfigured();
    event MarketStarted(uint256 round, uint256 endTime);
    event ProposalLaunched(string id, address yesToken, bytes32 poolId);
    event AgentRegistered(address agent, uint256 balance);
    event WinnerGraduated(string id, uint256 finalPrice);

    error OnlyBackend();
    error MarketInactive();
    error PermissionsAlreadyConfigured();
    error InvalidAddress();

    modifier onlyBackend() {
        if (msg.sender != backendSigner && msg.sender != owner()) revert OnlyBackend();
        _;
    }

    /**
     * @notice Deploy Router with pre-deployed contract addresses
     * @param _backendSigner Your backend wallet address
     * @param _vUSDC Address of deployed VerdictVirtualUSDCToken
     * @param _registry Address of deployed VerdictProposalRegistryStorage
     * @param _factory Address of deployed VerdictYESTokenDeployerFactory
     * @param _amm Address of deployed VerdictSimpleAMM
     */
    constructor(
        address _backendSigner,
        address _vUSDC,
        address _registry,
        address _factory,
        address _amm
    ) Ownable(msg.sender) {
        if (_backendSigner == address(0)) revert InvalidAddress();
        if (_vUSDC == address(0)) revert InvalidAddress();
        if (_registry == address(0)) revert InvalidAddress();
        if (_factory == address(0)) revert InvalidAddress();
        if (_amm == address(0)) revert InvalidAddress();

        backendSigner = _backendSigner;
        vUSDCToken = VerdictVirtualUSDCToken(_vUSDC);
        registry = VerdictProposalRegistryStorage(_registry);
        factory = VerdictYESTokenDeployerFactory(_factory);
        amm = VerdictSimpleAMM(_amm);

        emit ContractsLinked(_vUSDC, _registry, _factory, _amm);
    }

    /**
     * @notice Setup permissions on all contracts (call after deployment)
     * @dev Must be called by owner. Each contract must have transferred ownership to Router first.
     */
    function setupPermissions() external onlyOwner {
        if (permissionsConfigured) revert PermissionsAlreadyConfigured();

        // Setup permissions - these require the contracts to have set this Router as authorized
        vUSDCToken.authorizeMinter(address(this));
        registry.setMarketContract(address(this));
        factory.setMarketContract(address(this));
        amm.setRouter(address(this));

        permissionsConfigured = true;
        emit PermissionsConfigured();
    }

    // ================================================================
    //                      MARKET OPERATIONS
    // ================================================================

    struct ProposalInput {
        string id;
        string name;
        string description;
        string evalLogic;
        string mathLogic;
        uint256 resolutionDeadline;
        uint256 initialLiquidity;
    }

    function initializeMarket(uint256 duration) public onlyBackend {
        // ALWAYS CLEAR OLD DATA FOR A CLEAN START
        registry.clearMarket();

        isMarketActive = true;
        currentRound++; // Auto-increment
        registry.createMarket(currentRound, duration);
        emit MarketStarted(currentRound, block.timestamp + duration);
    }

    /**
     * @notice Batch initialization - starts round and creates all proposals in ONE transaction
     * @dev This solves nonce issues and ensures atomicity (all or nothing)
     */
    function initializeMarketWithProposals(
        uint256 duration,
        ProposalInput[] calldata proposalsToCreate
    ) external onlyBackend {
        // 1. Start the market round
        initializeMarket(duration);

        // 2. Create each proposal
        for (uint256 i = 0; i < proposalsToCreate.length; i++) {
            _createProposalInternal(proposalsToCreate[i]);
        }
    }

    function createProposal(
        string memory proposalId,
        string memory name,
        string memory description,
        string memory evalLogic,
        string memory mathLogic,
        uint256 resolutionDeadline,
        uint256 initialLiquidity
    ) external onlyBackend {
        _createProposalInternal(ProposalInput({
            id: proposalId,
            name: name,
            description: description,
            evalLogic: evalLogic,
            mathLogic: mathLogic,
            resolutionDeadline: resolutionDeadline,
            initialLiquidity: initialLiquidity
        }));
    }

    function _createProposalInternal(ProposalInput memory input) internal {
        // 1. Deploy YES Token via Factory
        address yesToken = factory.createYESToken(
            input.id, 
            string(abi.encodePacked("YES - ", input.name)), 
            string(abi.encodePacked("vYES-", input.id))
        );
        proposalToYesToken[input.id] = yesToken;

        // 2. Create AMM Pool
        bytes32 poolId = amm.createPool(input.id, address(vUSDCToken), yesToken);
        proposalToPoolId[input.id] = poolId;

        // 3. Add initial liquidity (50/50 for 0.5 starting price)
        if (input.initialLiquidity > 0) {
            vUSDCToken.mint(address(this), input.initialLiquidity);
            VerdictYESOutcomeToken(yesToken).mint(address(this), input.initialLiquidity);

            vUSDCToken.approve(address(amm), input.initialLiquidity);
            IERC20(yesToken).approve(address(amm), input.initialLiquidity);
            amm.addLiquidity(poolId, input.initialLiquidity, input.initialLiquidity);
        }

        // 4. Register in registry
        registry.addProposal(input.id, input.name, input.description, input.evalLogic, input.mathLogic, input.resolutionDeadline, yesToken);

        emit ProposalLaunched(input.id, yesToken, poolId);
    }

    function graduateProposal(string memory proposalId, uint256 finalPrice) external onlyBackend {
        registry.graduateProposal(proposalId, finalPrice);
        emit WinnerGraduated(proposalId, finalPrice);
    }

    // ================================================================
    //                          USER FUNCTIONS
    // ================================================================

    /**
     * @notice Allows any user to get 100 vUSDC to start trading
     */
    function userFaucet() external {
        vUSDCToken.faucetFromRouter(msg.sender, 100 * 10**vUSDCToken.decimals());
    }

    /**
     * @notice Register AI agent - ensures they have exactly 100 vUSDC (mints or burns as needed)
     * @param agent Agent address to register
     */
    function registerAgent(address agent) external onlyBackend {
        uint256 targetAmount = 100 * 10**vUSDCToken.decimals();
        uint256 currentBalance = vUSDCToken.balanceOf(agent);

        if (currentBalance > targetAmount) {
            // Burn excess to bring to 100
            uint256 excess = currentBalance - targetAmount;
            vUSDCToken.burn(agent, excess);
        } else if (currentBalance < targetAmount) {
            // Mint deficiency to bring to 100
            uint256 deficiency = targetAmount - currentBalance;
            vUSDCToken.mint(agent, deficiency);
        }
        // If already at 100, do nothing

        emit AgentRegistered(agent, targetAmount);
    }

    /**
     * @notice Batch register multiple agents - ensures each has exactly 100 vUSDC
     * @param agents Array of agent addresses to register
     */
    function registerAgentsBatch(address[] calldata agents) external onlyBackend {
        uint256 targetAmount = 100 * 10**vUSDCToken.decimals();

        for (uint256 i = 0; i < agents.length; i++) {
            uint256 currentBalance = vUSDCToken.balanceOf(agents[i]);

            if (currentBalance > targetAmount) {
                // Burn excess to bring to 100
                uint256 excess = currentBalance - targetAmount;
                vUSDCToken.burn(agents[i], excess);
            } else if (currentBalance < targetAmount) {
                // Mint deficiency to bring to 100
                uint256 deficiency = targetAmount - currentBalance;
                vUSDCToken.mint(agents[i], deficiency);
            }
            // If already at 100, do nothing

            emit AgentRegistered(agents[i], targetAmount);
        }
    }

    /**
     * @notice Reset an agent's balance to exactly 100 vUSDC (burn excess or mint deficiency)
     * @param agent Agent address to reset
     */
    function resetAgentBalanceTo100(address agent) external onlyBackend {
        uint256 targetAmount = 100 * 10**vUSDCToken.decimals();
        uint256 currentBalance = vUSDCToken.balanceOf(agent);

        if (currentBalance > targetAmount) {
            // Burn excess
            uint256 excess = currentBalance - targetAmount;
            vUSDCToken.burn(agent, excess);
        } else if (currentBalance < targetAmount) {
            // Mint deficiency
            uint256 deficiency = targetAmount - currentBalance;
            vUSDCToken.mint(agent, deficiency);
        }
        // If already at target, do nothing

        emit AgentRegistered(agent, targetAmount);
    }

    /**
     * @notice Batch reset multiple agents' balances to exactly 100 vUSDC
     * @param agents Array of agent addresses to reset
     */
    function resetAgentsBalanceTo100Batch(address[] calldata agents) external onlyBackend {
        uint256 targetAmount = 100 * 10**vUSDCToken.decimals();

        for (uint256 i = 0; i < agents.length; i++) {
            uint256 currentBalance = vUSDCToken.balanceOf(agents[i]);

            if (currentBalance > targetAmount) {
                // Burn excess
                uint256 excess = currentBalance - targetAmount;
                vUSDCToken.burn(agents[i], excess);
            } else if (currentBalance < targetAmount) {
                // Mint deficiency
                uint256 deficiency = targetAmount - currentBalance;
                vUSDCToken.mint(agents[i], deficiency);
            }
            // If already at target, do nothing

            emit AgentRegistered(agents[i], targetAmount);
        }
    }

    /**
     * @notice Swap vUSDC for YES tokens (or vice versa)
     * @param proposalId Proposal to trade
     * @param tokenIn Address of token to sell
     * @param amountIn Amount to sell
     * @param minAmountOut Minimum output (slippage protection)
     */
    function swap(
        string memory proposalId,
        address tokenIn,
        uint256 amountIn,
        uint256 minAmountOut
    ) external returns (uint256 amountOut) {
        bytes32 poolId = proposalToPoolId[proposalId];
        require(poolId != bytes32(0), "Pool not found");

        // Transfer tokens from user
        IERC20(tokenIn).transferFrom(msg.sender, address(this), amountIn);
        IERC20(tokenIn).approve(address(amm), amountIn);

        // Execute swap
        amountOut = amm.swap(poolId, tokenIn, amountIn, minAmountOut);

        // Transfer output to user
        address tokenOut = tokenIn == address(vUSDCToken) 
            ? proposalToYesToken[proposalId] 
            : address(vUSDCToken);
        IERC20(tokenOut).transfer(msg.sender, amountOut);

        return amountOut;
    }

    // ================================================================
    //                          GETTERS
    // ================================================================

    function getProposalStatus(string memory id) external view returns (VerdictProposalRegistryStorage.Proposal memory) {
        return registry.getProposal(id);
    }

    function getGraduatedProposals() external view returns (string[] memory) {
        return registry.getGraduatedProposals();
    }

    function getRoundInfo() external view returns (VerdictProposalRegistryStorage.Market memory) {
        return registry.getCurrentMarket();
    }

    function getYesTokenAddress(string memory proposalId) external view returns (address) {
        return proposalToYesToken[proposalId];
    }

    /**
     * @notice Get current YES token price for a proposal
     * @param proposalId Proposal ID
     * @return price YES price (0.5e18 = 50% probability)
     */
    function getYESPrice(string memory proposalId) external view returns (uint256) {
        return amm.getYESPrice(proposalId);
    }

    /**
     * @notice Get expected output for a swap
     */
    function getSwapQuote(
        string memory proposalId,
        address tokenIn,
        uint256 amountIn
    ) external view returns (uint256) {
        bytes32 poolId = proposalToPoolId[proposalId];
        return amm.getAmountOut(poolId, tokenIn, amountIn);
    }

    /**
     * @notice Get pool reserves for a proposal
     */
    function getPoolReserves(string memory proposalId) external view returns (uint256 vUSDCReserve, uint256 yesReserve) {
        bytes32 poolId = proposalToPoolId[proposalId];
        return amm.getReserves(poolId);
    }

    /**
     * @notice Get all deployed contract addresses
     */
    function getDeployedContracts() external view returns (
        address _vUSDC,
        address _registry,
        address _factory,
        address _amm
    ) {
        return (
            address(vUSDCToken),
            address(registry),
            address(factory),
            address(amm)
        );
    }

    /**
     * @notice Get user's vUSDC balance
     */
    function getVUSDCBalance(address user) external view returns (uint256) {
        return vUSDCToken.balanceOf(user);
    }

    /**
     * @notice Get user's YES token balance for a proposal
     */
    function getYESBalance(string memory proposalId, address user) external view returns (uint256) {
        address yesToken = proposalToYesToken[proposalId];
        if (yesToken == address(0)) return 0;
        return IERC20(yesToken).balanceOf(user);
    }
}

contracts/VerdictProposalRegistryStorage.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

/**
 * @title VerdictProposalRegistryStorage - On-Chain Storage for Active and Graduated Proposals
 * @notice Central registry for all prediction markets and graduated proposals
 * @dev Stores active markets, graduated winners, and market metadata on-chain
 */
contract VerdictProposalRegistryStorage {
    struct Proposal {
        string id;
        string name;
        string description;
        string evaluationLogic;
        string mathematicalLogic;
        uint256 resolutionDeadline;
        address poolAddress;
        bool resolved;
        bool isWinner;
        uint256 yesTWAP;
        uint256 timestamp;
    }

    struct Market {
        uint256 roundNumber;
        uint256 roundStartTime;
        uint256 roundEndTime;
        uint256 roundDuration;
        string[] proposalIds;
        bool active;
    }

    address public owner;
    address public marketContract;
    Market public currentMarket;
    mapping(string => Proposal) public proposals;
    string[] public graduatedProposalIds;
    string[] public activeProposalIds;

    event MarketCreated(uint256 roundNumber, uint256 startTime, uint256 endTime);
    event ProposalAdded(string indexed proposalId, string name, address poolAddress);
    event ProposalGraduated(string indexed proposalId, string name, uint256 yesTWAP);
    event MarketResolved(uint256 roundNumber, string winningProposalId);
    event MarketCleared();

    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner");
        _;
    }

    modifier onlyMarketContract() {
        require(msg.sender == marketContract, "Only market contract");
        _;
    }

    constructor() {
        owner = msg.sender;
    }

    function setMarketContract(address _marketContract) external onlyOwner {
        require(_marketContract != address(0), "Invalid address");
        marketContract = _marketContract;
    }

    function createMarket(uint256 roundNumber, uint256 roundDuration) external onlyMarketContract {
        // ALLOW OVERWRITING - remove the active check

        currentMarket = Market({
            roundNumber: roundNumber,
            roundStartTime: block.timestamp,
            roundEndTime: block.timestamp + roundDuration,
            roundDuration: roundDuration,
            proposalIds: new string[](0),
            active: true
        });

        emit MarketCreated(roundNumber, block.timestamp, block.timestamp + roundDuration);
    }

    function addProposal(
        string memory proposalId,
        string memory name,
        string memory description,
        string memory evaluationLogic,
        string memory mathematicalLogic,
        uint256 resolutionDeadline,
        address poolAddress
    ) external onlyMarketContract {
        require(currentMarket.active, "No active market");
        require(poolAddress != address(0), "Invalid pool address");

        proposals[proposalId] = Proposal({
            id: proposalId,
            name: name,
            description: description,
            evaluationLogic: evaluationLogic,
            mathematicalLogic: mathematicalLogic,
            resolutionDeadline: resolutionDeadline,
            poolAddress: poolAddress,
            resolved: false,
            isWinner: false,
            yesTWAP: 0,
            timestamp: block.timestamp
        });

        currentMarket.proposalIds.push(proposalId);
        activeProposalIds.push(proposalId);

        emit ProposalAdded(proposalId, name, poolAddress);
    }

    function graduateProposal(string memory proposalId, uint256 yesTWAP) external onlyMarketContract {
        Proposal storage proposal = proposals[proposalId];
        require(bytes(proposal.id).length > 0, "Proposal not found");
        require(!proposal.resolved, "Already resolved");

        proposal.resolved = true;
        proposal.isWinner = true;
        proposal.yesTWAP = yesTWAP;

        graduatedProposalIds.push(proposalId);

        emit ProposalGraduated(proposalId, proposal.name, yesTWAP);
    }

    function resolveMarket(string memory winningProposalId) external onlyMarketContract {
        require(currentMarket.active, "No active market");
        currentMarket.active = false;
        emit MarketResolved(currentMarket.roundNumber, winningProposalId);
    }

    function clearMarket() external onlyMarketContract {
        delete activeProposalIds;
        delete currentMarket;
        emit MarketCleared();
    }

    function getGraduatedProposals() external view returns (string[] memory) {
        return graduatedProposalIds;
    }

    function getActiveProposals() external view returns (string[] memory) {
        return activeProposalIds;
    }

    function getProposal(string memory proposalId) external view returns (Proposal memory) {
        return proposals[proposalId];
    }

    function getCurrentMarket() external view returns (Market memory) {
        return currentMarket;
    }

    function isMarketActive() external view returns (bool) {
        return currentMarket.active;
    }

    function getTimeRemaining() external view returns (uint256) {
        if (!currentMarket.active || block.timestamp >= currentMarket.roundEndTime) {
            return 0;
        }
        return currentMarket.roundEndTime - block.timestamp;
    }
}

contracts/VerdictSimpleAMM.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

import "./utils/@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "./utils/@openzeppelin/contracts/access/Ownable.sol";

/**
 * @title VerdictSimpleAMM - Built-in AMM for vUSDC/YES Token Trading
 * @notice Simple constant product market maker (x * y = k) like Uniswap
 * @dev No external dependencies - fully self-contained
 */
contract VerdictSimpleAMM is Ownable {

    struct Pool {
        address tokenA;      // Always vUSDC
        address tokenB;      // YES token for proposal
        uint256 reserveA;    // vUSDC reserve
        uint256 reserveB;    // YES token reserve
        bool exists;
    }

    // Pool ID => Pool data
    mapping(bytes32 => Pool) public pools;

    // Proposal ID => Pool ID
    mapping(string => bytes32) public proposalToPool;

    // Trading fee (0.3% = 30 basis points)
    uint256 public constant FEE_BPS = 30;
    uint256 public constant BPS_DENOMINATOR = 10000;

    // Router address that can manage pools
    address public router;

    event PoolCreated(bytes32 indexed poolId, string proposalId, address tokenA, address tokenB);
    event LiquidityAdded(bytes32 indexed poolId, uint256 amountA, uint256 amountB);
    event LiquidityRemoved(bytes32 indexed poolId, uint256 amountA, uint256 amountB);
    event Swap(bytes32 indexed poolId, address indexed trader, address tokenIn, uint256 amountIn, address tokenOut, uint256 amountOut);

    modifier onlyRouter() {
        require(msg.sender == router || msg.sender == owner(), "Only router");
        _;
    }

    constructor() Ownable(msg.sender) {}

    function setRouter(address _router) external onlyOwner {
        require(_router != address(0), "Invalid router");
        router = _router;
    }

    /**
     * @notice Create a new pool for a proposal
     * @param proposalId Proposal ID
     * @param tokenA vUSDC address
     * @param tokenB YES token address
     */
    function createPool(
        string memory proposalId,
        address tokenA,
        address tokenB
    ) external onlyRouter returns (bytes32 poolId) {
        poolId = keccak256(abi.encodePacked(proposalId, tokenA, tokenB));

        // NO CHECKS - Just create the record

        pools[poolId] = Pool({
            tokenA: tokenA,
            tokenB: tokenB,
            reserveA: 0,
            reserveB: 0,
            exists: true
        });

        proposalToPool[proposalId] = poolId;

        emit PoolCreated(poolId, proposalId, tokenA, tokenB);
        return poolId;
    }

    /**
     * @notice Add initial liquidity to a pool
     * @param poolId Pool ID
     * @param amountA Amount of vUSDC
     * @param amountB Amount of YES token
     */
    function addLiquidity(
        bytes32 poolId,
        uint256 amountA,
        uint256 amountB
    ) external onlyRouter {
        Pool storage pool = pools[poolId];
        require(pool.exists, "Pool not found");

        // Transfer tokens to this contract
        IERC20(pool.tokenA).transferFrom(msg.sender, address(this), amountA);
        IERC20(pool.tokenB).transferFrom(msg.sender, address(this), amountB);

        pool.reserveA += amountA;
        pool.reserveB += amountB;

        emit LiquidityAdded(poolId, amountA, amountB);
    }

    /**
     * @notice Swap tokens using constant product formula
     * @param poolId Pool ID
     * @param tokenIn Address of input token
     * @param amountIn Amount of input token
     * @param minAmountOut Minimum output (slippage protection)
     * @return amountOut Actual output amount
     */
    function swap(
        bytes32 poolId,
        address tokenIn,
        uint256 amountIn,
        uint256 minAmountOut
    ) external returns (uint256 amountOut) {
        Pool storage pool = pools[poolId];
        require(pool.exists, "Pool not found");
        require(tokenIn == pool.tokenA || tokenIn == pool.tokenB, "Invalid token");

        bool isAtoB = (tokenIn == pool.tokenA);

        uint256 reserveIn = isAtoB ? pool.reserveA : pool.reserveB;
        uint256 reserveOut = isAtoB ? pool.reserveB : pool.reserveA;
        address tokenOut = isAtoB ? pool.tokenB : pool.tokenA;

        // Calculate output using x * y = k formula with fee
        uint256 amountInWithFee = amountIn * (BPS_DENOMINATOR - FEE_BPS);
        amountOut = (amountInWithFee * reserveOut) / (reserveIn * BPS_DENOMINATOR + amountInWithFee);

        require(amountOut >= minAmountOut, "Slippage exceeded");
        require(amountOut > 0, "Insufficient output");

        // Transfer tokens
        IERC20(tokenIn).transferFrom(msg.sender, address(this), amountIn);
        IERC20(tokenOut).transfer(msg.sender, amountOut);

        // Update reserves
        if (isAtoB) {
            pool.reserveA += amountIn;
            pool.reserveB -= amountOut;
        } else {
            pool.reserveB += amountIn;
            pool.reserveA -= amountOut;
        }

        emit Swap(poolId, msg.sender, tokenIn, amountIn, tokenOut, amountOut);
        return amountOut;
    }

    /**
     * @notice Get the current price of tokenB in terms of tokenA
     * @param poolId Pool ID
     * @return price Price (scaled by 1e18)
     */
    function getPrice(bytes32 poolId) external view returns (uint256 price) {
        Pool storage pool = pools[poolId];
        require(pool.exists, "Pool not found");
        require(pool.reserveB > 0, "No liquidity");

        // Price = reserveA / reserveB (scaled by 1e18)
        return (pool.reserveA * 1e18) / pool.reserveB;
    }

    /**
     * @notice Get YES token price for a proposal (0 to 1 scaled by 1e18)
     * @param proposalId Proposal ID
     * @return yesPrice YES price (0.5e18 = 50% chance)
     */
    function getYESPrice(string memory proposalId) external view returns (uint256 yesPrice) {
        bytes32 poolId = proposalToPool[proposalId];
        Pool storage pool = pools[poolId];
        require(pool.exists, "Pool not found");
        require(pool.reserveA + pool.reserveB > 0, "No liquidity");

        // YES price = reserveA / (reserveA + reserveB)
        // This gives probability between 0 and 1
        return (pool.reserveA * 1e18) / (pool.reserveA + pool.reserveB);
    }

    /**
     * @notice Calculate output amount for a swap without executing
     * @param poolId Pool ID
     * @param tokenIn Input token address
     * @param amountIn Input amount
     * @return amountOut Expected output
     */
    function getAmountOut(
        bytes32 poolId,
        address tokenIn,
        uint256 amountIn
    ) external view returns (uint256 amountOut) {
        Pool storage pool = pools[poolId];
        require(pool.exists, "Pool not found");

        bool isAtoB = (tokenIn == pool.tokenA);
        uint256 reserveIn = isAtoB ? pool.reserveA : pool.reserveB;
        uint256 reserveOut = isAtoB ? pool.reserveB : pool.reserveA;

        uint256 amountInWithFee = amountIn * (BPS_DENOMINATOR - FEE_BPS);
        amountOut = (amountInWithFee * reserveOut) / (reserveIn * BPS_DENOMINATOR + amountInWithFee);

        return amountOut;
    }

    /**
     * @notice Get pool reserves
     * @param poolId Pool ID
     * @return reserveA vUSDC reserve
     * @return reserveB YES token reserve
     */
    function getReserves(bytes32 poolId) external view returns (uint256 reserveA, uint256 reserveB) {
        Pool storage pool = pools[poolId];
        return (pool.reserveA, pool.reserveB);
    }

    /**
     * @notice Get pool by proposal ID
     * @param proposalId Proposal ID
     * @return Pool data
     */
    function getPoolByProposal(string memory proposalId) external view returns (Pool memory) {
        bytes32 poolId = proposalToPool[proposalId];
        return pools[poolId];
    }
}

contracts/VerdictVirtualUSDCToken.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

import "./utils/@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "./utils/@openzeppelin/contracts/access/Ownable.sol";

/**
 * @title VerdictVirtualUSDCToken - Virtual USD Coin for Verdict Prediction Markets
 * @notice Mock ERC20 token representing virtual USD for trading
 * @dev Only authorized market router contracts can mint/burn tokens
 */
contract VerdictVirtualUSDCToken is ERC20, Ownable {
    mapping(address => bool) public authorizedMinters;

    event MinterAuthorized(address indexed minter);
    event MinterRevoked(address indexed minter);
    event TokensMinted(address indexed to, uint256 amount);
    event TokensBurned(address indexed from, uint256 amount);

    constructor() ERC20("Virtual USD Coin", "vUSDC") Ownable(msg.sender) {
        _mint(msg.sender, 1000000 * 10**decimals());
    }

    function authorizeMinter(address minter) external onlyOwner {
        require(minter != address(0), "Invalid minter address");
        authorizedMinters[minter] = true;
        emit MinterAuthorized(minter);
    }

    function revokeMinter(address minter) external onlyOwner {
        authorizedMinters[minter] = false;
        emit MinterRevoked(minter);
    }

    function mint(address to, uint256 amount) external {
        require(authorizedMinters[msg.sender], "Not authorized to mint");
        _mint(to, amount);
        emit TokensMinted(to, amount);
    }

    function burn(address from, uint256 amount) external {
        require(authorizedMinters[msg.sender], "Not authorized to burn");
        _burn(from, amount);
        emit TokensBurned(from, amount);
    }

    function faucet(uint256 amount) external {
        require(amount <= 1000 * 10**decimals(), "Max 1000 vUSDC per claim");
        _mint(msg.sender, amount);
        emit TokensMinted(msg.sender, amount);
    }

    function faucetFromRouter(address user, uint256 amount) external {
        require(authorizedMinters[msg.sender], "Only authorized router");
        _mint(user, amount);
        emit TokensMinted(user, amount);
    }
}

